import React, { Component } from "react";
import { Menu, Icon, Input, Avatar, Badge, Dropdown } from "antd";
import { MenuItem } from "rc-menu";
import Test from "../Test";

const { SubMenu } = Menu;
const { Search } = Input;

class AppNavbar extends Component {
  state = { menuItemWitdh: "150" };

  render() {
    return (
      <Menu
        mode="horizontal"
        style={{ width: this.props.width, height: this.props.height }}
      >
        <Menu.Item key="home">
          <a href="/">
            <Icon type="home" />
            SUSTechDoc
          </a>
        </Menu.Item>
        <SubMenu></SubMenu>
        <MenuItem style={{ width: this.state.menuItemWitdh, float: "right" }}>
          <Test />
          {/* <Dropdown overlay={userOptions}>
            <Badge count={1} className="ant-dropdown-link">
              <Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />
            </Badge>
          </Dropdown> */}
        </MenuItem>
        <Menu.Item style={{ width: this.state.menuItemWitdh, float: "right" }}>
          <Search
            placeholder="Search Files"
            onSearch={value => console.log(value)}
          />
        </Menu.Item>
      </Menu>
    );
  }
}

export default AppNavbar;
